pole = [[0] * x for _ in range(y)]  



def randomize():
    for i in range(y):
        for j in range(x):
            rand_int = random.randint(0, spawn_rarity)
            if rand_int == 0:
                pole[i][j] = 1


def count_neighbours(i, j):
    count = 0
    try: 
        if pole[i-1][j-1] == 1: count += 1
    except: pass

    try:
        if pole[i-1][j] == 1: count += 1
    except: pass
    try:
        if pole[i][j-1] == 1: count += 1
    except: pass

    try:
        if pole[i+1][j+1] == 1: count += 1
    except: pass

    try:
        if pole[i+1][j] == 1: count += 1
    except: pass
    try:
        if pole[i][j+1] == 1: count += 1
    except: pass

    try:
        if pole[i+1][j-1] == 1: count += 1
    except: pass
    try:
        if pole[i-1][j+1] == 1: count += 1
    except: pass

    return count
def chenge_pole():
    xy_to_chenge = []
    borned = 0
    died = 0
    for i in range(y):
        for j in range(x):
            #?print(i, j)
            count8 = count_neighbours(i, j)
            #?print(count8)
            if pole[i][j] == 0:
                if count8 in rule_b:
                    #pole[i][j] = 1
                    xy_to_chenge.append([i, j, 1])
                    borned += 1
            
            if pole[i][j] == 1:
                #?print('check')
                if count8 not in rule_s:
                    #pole[i][j] = 0
                    xy_to_chenge.append([i, j, 0])
                    #?print(f'ij{i}{j}')
                    #?print(f'pole{i}{j} DIE')
                    died += 1
            


    for i in xy_to_chenge:
        pole[i[0]][i[1]] = i[2]
    
    return borned, died

    
                

def print_pole():
    for i in range(y):
        con.print(f'|', end='')
        for j in range(x):
            if theme == 'light':
                if pole[i][j] == 1:
                    print(' ', end="")#!print("█", end="")
                else:
                    print('█', end="")#!print(" ", end="")

            elif theme == 'dark':
                if pole[i][j] == 1:
                    print('█', end="")#!print("█", end="")
                else:
                    print(' ', end="")#!print(" ", end="")
        print()

def count_points():
    life = 0
    for i in range(y):
        for j in range(x):
            if pole[i][j] == 1:
                life += 1
            else: pass
    return life


def main():
    iteretion = 0
    if rand_gen: randomize()
    print_pole()
